import React from "react";

const Grades = () => {
  return (
    <div className="py-5 text-center">
      <h2>Grades</h2>
      <p>This is the Grades module. See your scores for quizzes, exams, recitations, and projects here.</p>
    </div>
  );
};

export default Grades;
